INSERT INTO `produto` VALUES (1,'New Belgium Fat Tire Amber Ale - Lata 355ml','A Cerveja Americana New Belgium Fat Tire Amber Ale é uma cerveja de coloração âmbar, corpo médio e espuma de boa formação. Apresenta notas de malte tostado e caramelo perfeitamente equilibradas com o frescor do lúpulo. Estilo: Amber Ale Teor Alcoólico: 5,2% Volume: 355 ml',19.9,1,96,_binary 'data:application/octet-stream;base64,'),(2,'New Belgium Voodoo Ranger IPA - Lata 355ml','A cerveja Americana New Belgium Voodoo Ranger IPA é uma India Pale Ale que leva em sua receita os lúpulos Nugget, Cascade, Simcoe, Chinook, Mosaic e Amarillo. Apresenta coloração dourada, espuma de boa formação, corpo médio com notas nos aromas e sabores que remetem ao frutado, cítrico e floral. Seu final é refrescante e com perfeito amargor. Estilo: American IPA Teor Alcoólico: 7% Volume: 355 ml',21.9,1,100,_binary 'data:application/octet-stream;base64,'),(3,'Courage Imperial Russian Stout - Garrafa 275 ml','Essa Russian Imperial Stout, possui coloração escura profunda, corpo bastante robusto e com boa formação de espuma. Produzida apenas uma vez por ano, esta cerveja de guarda que fica ainda melhor depois de 13 anos, apresenta sabor torrado, encorpado e com amargor bem equilibrado. Seu aroma frutado traz notas de café torrado, chocolate e leve frescor defumado. Estilo: Russian Imperial Stout Teor Alcoólico: 10% Volume: 275 ml',32.9,1,100,_binary 'data:application/octet-stream;base64,'),(4,'Newcastle Brown Ale - Garrafa 550ml','Fermentada pela primeira vez em 1927 pelo coronel Jim Porter Newcastle Brown Ale alcançou um sucesso imediato com os juízes do campeonato internacional de fermentação de 1928, quando ganhou o campeonato de cerveja. Desde então a marca não parou de crescer dentro do Reino Unido Recentemente Newcastle Brown Ale recebeu um indicador de proteção geográfica, símbolo da União Européia. Isto significa que só a Newcastle Brown Ale fermentada em Newcastle–Upon–Tyne pode ser chamada de Newcastle Brown Ale.    Família: Ale    Estilo: Brown Ale    Teor Alcoólico: 4,7%    Volume: 550ml    Origem: Inglaterra',29.99,1,100,_binary 'data:application/octet-stream;base64,'),(5,'Aecht Schlenkerla Rauchbier Weizen - Garrafa 500ml','Aecht Schlenkerla Rauchbier Weizen (pronúncia: écht xlenkérla rauchbier) é a cerveja mais tradicional do tipo \"Rauchbier\" da Alemanha. É fabricada desde 1678 na cidade de Bamberg, no Estado alemão da Baviera. Tem graduação alcoólica de 5,2% e a sua temperatura ideal para apreciação é de 7-8°C. Cerveja de coloração acobreada, produzida com trigo e maltes defumados. No aroma e no sabor, notas de banana, cravo e defumado intenso. Perfeita com carnes defumadas. Estilo: Weizen Rauchbier Teor alcoólico: 5,2%vol Volume: 500 ml  ',34.99,1,100,_binary 'data:application/octet-stream;base64,'),(6,'Konig Pilsener - 500 ml','Referência mundial no estilo german pilsener, possui cor dourada clara e espuma consistente. É leve, refrescante e amargor presente. Fundada em 1858 por Theodor König na cidade de Duisburg-Beeck. No primeiro ano, a produção foi de 206 hectolitros e a maior parte foi vendida nas cidades próximas. Após mais de 150 anos, hoje a KÖNIG PILSENER (tradução REI DAS PILSNERS) é uma cerveja que se posiciona como uma das melhores recompensas ao final de um bem sucedido dia de trabalho, encontrada em locais de ótimo padrão e consumida para comemorar grandes conquistas. Harmonização: Aperitivo, pães, queijos leves, saladas, azeitonas verdes, amêndoas, canapés frios, carnes brancas pouco gordurosas, pratos leves. Estilo: German Pilsener Teor alcoólico: 4,9% Volume: 500 ml',19.9,1,100,_binary 'data:application/octet-stream;base64,'),(7,'Averbode Ale - Garrafa 330ml','Averbode é uma autêntica cerveja de abadia do estilo Belgian Blond Ale produzida pela fábrica da Delirium para os monges da Abadia de Averbode, de 1134. É o resgate da tradição histórica de Averbode, que produziu cervejas do século XIV até o século XX. Uma cerveja artesanal multigrãos fina e elegante, feita com malte de cevada, aveia e espelta, com dryhopping e refermentação na garrafa, que deixa a cerveja mais frutada, fresca e frisante. Coloração amarelo intenso, levemente turva e com boa formação de espuma.   Família: Ale Estilo: Belgian Blond Ale Teor Alcoolico: 7.5% Volume: 330 ml',25.9,1,100,_binary 'data:application/octet-stream;base64,'),(8,'Blanche de Neiges Witbier - Garrafa 330ml','A Branca de Neve tem as bases de uma Blanche tradicional, com um volume de 5% de álcool. A Blanche é, no entanto, diferente no sabor em relação aos seus homólogos, principalmente por uma profunda amargura sobre um buque de aromas perfumados exóticos. Possui uma leve sensação de curaçao e um amargor de raspas de casca de laranja. Algumas especiarias de bom gosto a torna bastante refrescante. La Blanche des Neiges, não tem acidez pronunciada o que faz dela uma Blanche bastante original e muito refrescante. Sua cor é muito importante, pois é muito clara, mas ainda nebulosa. Estilo: Witbier Teor Alcoólico: 5% Volume: 330 ml Cervejaria: Huyghe',18.9,1,100,_binary 'data:application/octet-stream;base64,'),(9,'Coruja Lager - Garrafa 355ml','A Coruja Lager é uma cerveja de baixa fermentação, refrescante e equilibrada e muito fácil de beber. Tem a aparência de coloração dourado clara, límpida e de colarinho branco e persistente. Levemente seca, mas com o equilíbrio entre o malte e o lúpulo, esse produto é perfeito para brindar com os amigos e matar a sede durante longos períodos. Estilo: American Lager Teor Alcoólico: 4.6% Volume: 355 ml',11.99,1,100,_binary 'data:application/octet-stream;base64,'),(10,'Coruja Strix Extra Munich Helles - Garrafa 500ml','Produzida em Forquilhinha (SC), a gaúcha Coruja Strix é uma cerveja acobreada, de sabor acentuado e aroma diferenciado é marcante já no primeiro gole. Força dos maltes especiais e refrescância no mix de lúpulos.         Amargor: 25 IBU Densidade Original: 16% º P Harmonizar com frutos do mar, peixes, carnes defumadas e queijos semiduros. 6,5% vol. Volume: 500ml',20.99,1,100,_binary 'data:application/octet-stream;base64,'),(11,'BrewDog Punk IPA - Lata 330ml','De coloração âmbar com leve turbidez, possui creme de boa formação e estabilidade. No aroma, uma explosão de lúpulos cítricos, lembrando frutas como kiwi, lichia e maracujá. O malte aparece em segundo plano, formando um conjunto equilibrado. Seca e adstringente, seu final é bastante amargo.   Estilo: India Pale Ale Teor Alcoólico: 6.0%   Volume: Lata - 330 ml IBU: 68',17.9,1,100,_binary 'data:application/octet-stream;base64,'),(12,'Brewdog Dead Pony Ale - Lata 330ml','American Pale Ale da escocesa Brewdog produzida com generosas quantidades de lúpulos califórnianos para dar um toque cítrico potente e marcante. A base de maltes tostados, dá lugar ao frescor picante do lúpulo, que lembra frutas tropicais e garante uma ótima drinkability. Família: Ale Estilo: American Pale Ale  Teor Alcoólico: 3,8% Volume: 330 ml',17.9,1,100,_binary 'data:application/octet-stream;base64,');
